$(document).ready(function(){$("[data-bs-hover-animate]").mouseenter(function(){var a=$(this);a.addClass("animated "+a.attr("data-bs-hover-animate"))}).mouseleave(function(){var a=$(this);a.removeClass("animated "+a.attr("data-bs-hover-animate"))})}),$(function(){$("#form").submit(function(){return $.ajax({type:"POST",url:"http://www.techzone.online/send_mail.php",data:{name:$(this).name.value,email:$(this).email.value,mobile:$(this).mobile.value,message:$(this).message.value}}),!1})});